import React, { useRef, useState } from 'react';
import './App.css';
import Enter from "./Enter";


function App() {
    const [inputs, setInputs] = useState({
        username: '',
        email: ''
    });
    const onChange = (e)=>{
        let {name,value} = e.target
        console.log('name,value',name,value);
        setInputs({
            ...inputs,
            [name]: value
        });
    }

  return (
    <>
      <Enter onChange={onChange}></Enter>
    </>
  );
}

export default App;
